import { MenuStyle } from "../../../styles/FrontPageStyle/NavBar.style.ts";

function Logo() {
  return (
    <MenuStyle>
      <a>About me</a>
      <a>Projects</a>
      <a>Technologies</a>
    </MenuStyle>
  );
}

export default Logo;
